import React from 'react';



export default function UserInfo() {

    if (sessionStorage.getItem("user_role") == 1)
    {
        return (
            <div>
                <h3>Account information</h3>
            </div>
        )
    }

    else
    {
        return (
            <div>
                <h1 style={{color: "red", fontWeight: 900, fontSize: 16, marginLeft: 130}}>Unauthorized</h1>
            </div>
        )
    }
    
}
